const initialState = {
  mainPosts: [
    {
      id: 1,
      User: {
        id: 1,
        nickname: "제로초",
      },
      content: "첫 번쨰 게시글 #해시태그 #익스프레스",
      Images: [
        {
          src: "https://djkdjifjqoff/dddqqf",
        },
        { src: "https://dqfqff/qefqfddd/bbb" },
        { src: "https://dqfqff/qefqfddd/bbb" },
      ],
    },
  ],
};

// (이전상태, 액션) => 다음상태
export default (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};
